F.definição:
Percepção Sensorial: Faculdade para ouvir, devido 
a respostas a estímulos dos órgãos da audição; 
potencialidade para ouvir.

Discriminação de Gênero: Predisposição para 
valorizar um gênero mais do que outro; 
discriminação entre crianças pelo gênero.

Dor Musculoesquelética: Desconforto moderado a 
severo, proveniente de uma condição inflamatória; 
possivelmente inclui articulações edemaciadas.

Comportamento Agressivo: Conflito aberto, 
armado, conduzido entre grupos ou nações; 
relações políticas com outros significados.

Percepção: Sensação de desejo para beber água ou 
outro líquido, referida à boca e garganta; 
membrana mucosa seca na boca e garganta.

Percepção Sensorial: Faculdade de ver, devido a 
respostas a estímulos dos órgãos visuais; 
potencialidade para ver.
